(519, 'أن يتمكن التلاميذ من تتبع كتابة حرف بإصبعين\"ب\" في شكليه المتصل والمنفصل بشكل صحيح.\n', '2024-08-10 08:42:55', '2024-08-10 08:42:55'),
(520, 'أن يحدد الصور التي تبدأ بحرف \"ب\" من بين مجموعة من الصور.\n', '2024-08-10 08:43:38', '2024-08-10 08:43:38'),
(521, 'أن يتعرف على حرف \"ب\" من بين مجموعة من الحروف الأخرى.\n', '2024-08-10 08:44:15', '2024-08-10 08:44:15'),
(522, 'أن يستبعد التلاميذ الصور التي لا تبدأ بحرف \"ب\" من بين مجموعة من الصور.\n', '2024-08-10 08:44:50', '2024-08-10 08:44:50'),
(523, 'اختيار الكلمة الصحيحة التي تحتوي على صوت حرف \"ب\" من بين مجموعة من الكلمات\n', '2024-08-10 08:45:29', '2024-08-10 08:45:29'),
(524, 'اختيار الصوت الصحيح لحرف \"ب\" بناءً على الصورة المعروضة.\n', '2024-08-10 08:46:23', '2024-08-10 08:46:23'),
(525, 'ربط حرف \"ب\" بالصورة المناسبة بناءً على تشكيل وصوت الحرف\n', '2024-08-10 08:47:01', '2024-08-10 08:47:01'),
(526, 'تصنيف الحروف داخل الأكواب المناسبة.\n', '2024-08-10 08:47:46', '2024-08-10 08:47:46'),
(527, 'وضع علامة عند نطق الحرف الموجود على اللوحة عند سماعه.\n', '2024-08-10 08:48:23', '2024-08-10 08:48:23'),
(528, 'تصنيف الصور حسب الحرف الأول المناسب لها.\n', '2024-08-10 08:49:03', '2024-08-10 08:49:03'),
(529, 'استبعاد الصور التي لا تبدأ بالصوت الأول للحرف المحدد.\n', '2024-08-10 08:49:40', '2024-08-10 08:49:40'),
(530, 'اختيار الحرف الصحيح الذي يتوافق مع الصورة.\n', '2024-08-10 08:51:34', '2024-08-10 08:51:34'),
(531, 'تكوين كلمات صحيحة بناءً على الصورة المعروضة باستخدام الحروف .\n', '2024-08-10 08:52:39', '2024-08-10 08:52:39'),
